import React from "react";

class About extends React.Component {
  constructor() {
    super();
  }

  render() {
    return (
      <div className="main">
        <div className="header">
          <nav className="navbar">
            <a>LOGO</a>
            <a>ABOUT US</a>
            <a>PRICE</a>
            <a>SERVICE</a>
            <a>FAQ</a>
            <a>CONTACT</a>
          </nav>
        </div>
      </div>
    );
  }
}

export default About;
